import React from 'react'
import df from "./Data"
const First = () => {
  return (
    <div>
        <h1>Audio-Books Catelogue</h1>
        <div>
            {df.map((d)=>(
                <div>
                    <img src={d.cover} alt="" />
                    <h1>{d.title}</h1>
                    <h3>{d.author}</h3>
                    </div>
            ))}
        </div>

      
    </div>
  )
}

export default First
